import React, { useState } from 'react'
import { FileUpLoad } from './components/upload';
function App() {
  const [files, setFiles] = useState([]);
  return (
    <div className='App'>
      <p className='title'>Upload File</p>
      <FileUpLoad files={files} setFiles={setFiles} />
    </div>
  )
}

export default App
